import React from 'react';
import './Navigation.css';
import {Link} from "react-router-dom";

class Navigation extends React.Component {
    render(){

        return (
            <nav>
               <h2 className="Logo">Will Luong</h2>

               <ul className="nav-links">
                   <Link to='/contact'>
                        <li>Contact</li>
                   </Link>

               </ul> 
            </nav>

        );

    }


}


export default Navigation;
